import React from "react";
import './MyName.css'

function MyName() {
    return (
        <div className="MyName">
            <p className="MyName-test">Welcome!</p>
            <h1 className="MyName-test">Personal Info</h1>
            <p className="MyName-title">FirstName:</p>
            <input type="text" className="MyName-input" name="firstName"/>
            <p className="MyName-title">Last Name:</p>
            <input type="text" className="MyName-input" name="lastName"/><br/>
            <input type="submit" className="MyName-input" name="123" value="submit"/>
        </div>
    );
}

export default MyName
